Cara é igual disse Zé Ramalho na música admirável gado novo;
O povão ter q demonstrar sua coragem, a margem do q possa parecer.. e vê q toda essa engrenagem já sente a ferrugem lhe comer... Povo marcado povo feliz...  
Uma clara crítica ao regime capitalista selvagem, você só vale oq tem se você não tem nada você não vale nada simples assim
